import './App.css';
import { AuthContextProvider } from './Context/AuthContext';
import Navbar from './Components/Navbar';
import Home from './Components/Home';
import Login from './Components/Login'

function App() {
  return (
    <div>
      <AuthContextProvider>
        <Navbar />
        <Home />
        <Login />
      </AuthContextProvider>
    </div>
  );
}

export default App;
